Much of human learning happens through mimicry or mirroring. Biomimicry is a term coined that represents systems that are modeled on biological entities and processes. It‚Äôs one of several foundational reasons why you feel so damn fulfilled and nourished after spending time in natural landscapes limited from too many human projections. Time in nature is a determinate of health.
.
When I invite people into my medicinal and native plant educational garden, the Westgarden @thewhidbeyintitute, one of the first things you‚Äôll hear me say is that this is a wild garden representative of regenerative ag techniques and permaculture ethics. Wild also means that you are encouraged to show up as you are just as resident plants do.
.
If we allow the natural world to show up as they are then we are better able to mirror or mimic and allow ourselves to show up as we are. From there we begin the process that starts to break through our unhealthy human restrains, self criticisms and projections which will eventually teach us how to exhibit insight and awareness- how to learn to accept all of ourselves fully. 
.
.
.
.
